import React, { Component } from "react";

class Toc extends Component {
  render() {
    console.log("Toc");
    const lists = [];
    const data = this.props.data;
    for (let i = 0; i < data.length; i++) {
      lists = data.map((el) => {
        <li key={el.id}>
          <a href={"/content/" + el.id}>{el.title}</a>
        </li>;
      });
      lists.push(
        <li key={data[i].id}>
          <a
            href={"/content/" + data[i].id}
            onClick={(e) => {
              e.preventDefault();
              this.props.onChangePage();
            }}
          >
            {data[i].title}
          </a>
        </li>
      );
    }
    return (
      <nav>
        <ul>{lists}</ul>
      </nav>
    );
  }
}

export default Toc;
